const API_URL = `http://localhost:8000`;

export default () => {
    return fetch(`${API_URL}/lists`)//Performs a GET request to the API to get lists
        .then(response => response.json())
        .then(data => {
            console.log('Lists retrieved:', data);//// Print the lists on the console
            return data;
        })
        .catch(error => {
            console.error('Error fetching lists:', error);
            throw error;
        });
};
